import * as types from "../../actionTypes";
import CompanyApi from "../../../api/CompanyApi";

let actionsFunction = {

  //CRUD METHODS

  // Find by staff
  findBystaff: function(key) {
    return function(dispatch) {
      return CompanyApi
        .findBystaff(key)
        .then(item => {
          dispatch(actionsFunction.findBystaffSuccess(item));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  findBystaffSuccess: function(item) {
    return { type: types.FINDBYSTAFF_COMPANY_SUCCESS, payload: item };
  },


};

export default actionsFunction;
